import { Divider } from 'primereact/divider';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import react, { useState } from "react";
import "./data.json";


function App(){
    
    const [name,inputName]=useState();
    const [pwd,inputPwd]=useState();

   function submitHandler(e){
           e.preventDefalut();   
           
           const state = [  {"name": "mgmg",
           "pwd":"mub01"
           },
           {"name": "zawzaw",
           "pwd":"mub02"
           }]
          
           if(state.name === inputName){
            console.log(true);
           }
            
        }    
   

    return(
        <form className='form'>
               <div className="card">
            <div className="flex flex-column md:flex-row">
                <div className="w-full md:w-5 flex flex-column align-items-center justify-content-center gap-3 py-5">
                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Username</label>
                        <InputText id="username" type="text" className="w-12rem" placeholder='Enter your name' value={inputName} />
                    </div>
                    <div className="flex flex-wrap justify-content-center align-items-center gap-2">
                        <label className="w-6rem">Password</label>
                        <InputText id="password" type="password" className="w-12rem" placeholder='Enter your roll number' value={inputPwd} />
                    </div>
                    <Button label="Login" icon="pi pi-user" className="w-10rem mx-auto" onClick={(e)=>{submitHandler}}></Button>
                </div>
                
                
            </div>
        </div>
        </form>
     
       
     
    );
 

};



export default App;
